        def html_metadata(k, v):
            k = k[0].upper() + k[1:]

            if k == "Mut":
                k = "Mutations"
                v = ", ".join([f"{x[1]}{x[0]}{x[2]}" for x in v])
            if k == "Fs_flag":
                k == "Frameshift"
                v = "Has frameshift" if v else ""
            k = k.replace("_", " ")
            return f"<b>{k}:</b> {v}"

        def html_def_itemlist(items):

            res = "<ul>"
            for i in items:
                res += f"<li> {i} </li>"
            res += "</ul>"
            return res

        def html_template(mutation_name, cluster_name, lineage_name, num_cluster, perc_lineage, perc_cluster, fc,
                          epi_start, epi_stop, epi_seq, epi_linear, epi_nonlinear, sequences, list_linear,
                          list_nonlinear,
                          domains):
            res = ""
            mut_name_s = f'{mutation_name[1]}{mutation_name[0]}{mutation_name[2]}'
            res += f"""<div style='font-size:20px'>
                            <b>{mutation_name[1]}{mutation_name[0]}{mutation_name[2]}</b> 
                            in cluster <b>{cluster_name}</b> vs 
                            lineage <b>{lineage_name}</b>
                        </div>"""
            res += "<ul>"
            res += f"<li><b>Number of sequences in cluster {cluster_name} with mutation {mut_name_s}:</b> {num_cluster}</li>"
            res += f"<li><b>Percentage of sequences in cluster {cluster_name} with mutation {mut_name_s}:</b> {perc_cluster * 100:.2f}%</li>"
            res += f"<li><b>Percentage of sequences in lineage {lineage_name} with mutation {mut_name_s}:</b> {perc_lineage * 100:.2f}%</li>"
            res += f"<li><b>Fold change (%cluster / %lineage):</b> {fc:.2f}</li>"
            res += f'<li><b>Spike domain(s):</b> {", ".join(domains)}</li>'

            res += f"<li><b>Epitope (linear, from IEDB):</b> sequence {epi_seq} from position {epi_start} to {epi_stop} in Spike (combination of {epi_linear} linear epitopes)</li>"
            list_linear_a = [f'<a href="{a}">{a}</a>' for a in list_linear]
            res += f"<li><b>Publications linear epitopes:</b> {html_def_itemlist(list_linear_a)}</li>"

            res += f"<li><b>Epitope (non-linear, from IEDB):</b> overlapping {epi_nonlinear} non-linear epitopes</li>"

            if epi_nonlinear > 0:
                list_nonlinear_a = [f'<a href="{a}">{a}</a>' for a in list_nonlinear]
                res += f"<li><b>Publications non-linear epitopes:</b> {html_def_itemlist(list_nonlinear_a)}</li>"

            sequences = [f"""
            {x} <div id="div_{c}">
                    {html_def_itemlist([html_metadata(k, v)
                                        for k, v in metadata.loc[x].to_dict().items() if k not in ('cluster') and v])}
                </div>""" for x, c in zip(sequences, cont)]

            res += f"<li><b>Sequences:</b> {html_def_itemlist(sequences)}</li>"
            res += "</ul>"
            return res

